import './jogos.css'
import { Celula } from '../../models/bingo/celula';
import Select from 'react-select';
import { useState } from 'react';
import '../../models/bingo/celula.css'

function Jogos() {


  const [x3, setx3] = useState(false);
  const [x4, setx4] = useState(false);
  const [x5, setx5] = useState(false);
  const [classe, setClasse] = useState("x3");


  let cell1 = document.createElement(Celula);
  cell1.className = "celula";
  let cell2 = document.createElement(Celula);
  cell2.className = "celula";
  let cell3 = document.createElement(Celula);
  cell3.className = "celula";
  let cell4 = document.createElement(Celula);
