  cell16.className = "celula";
  let cell17 = document.createElement(Celula);
  cell17.className = "celula";
  let cell18 = document.createElement(Celula);
  cell18.className = "celula";
  let cell19 = document.createElement(Celula);
  cell19.className = "celula";
  let cell20 = document.createElement(Celula);
  cell20.className = "celula";
  
  let cell21 = document.createElement(Celula);
  cell21.className = "celula";
  let cell22 = document.createElement(Celula);
  cell22.className = "celula";
  let cell23 = document.createElement(Celula);
  cell23.className = "celula";
  let cell24 = document.createElement(Celula);
  cell24.className = "celula";
  let cell25 = document.createElement(Celula);
  cell25.className = "celula";
  function countLines() {
    let texto = document.getElementById("inputBingo").value;
    var lines = texto.split("\n");
    var count = lines.length;
    console.log(count);

    if (count <= 9) {
      lines.forEach(element => {
        let div3 = document.getElementById("x3div");
        let cell = document.createElement("Celula");
        cell.className = "celula"
        cell.innerText = element.toString();
        div3.appendChild(cell);
      });
      setx3(true)
      setx4(false)
      setx5(false)
      setClasse("x3");
    };
    if (count > 9 && count <= 16) {
      setx3(false)
      setx4(true)
      setx5(false)
      setClasse("x4");
    }
    if (count > 16 && count <= 25) {
      setx3(false)
      setx4(false)
      setx5(true)
      setClasse("x5");
    }


  }


  return (
    <div className="jogos">
      <div id='bingo' className={classe}>
        <div id="x3div" className={x3 ? "Aparece" : "escondido"}>
        </div>
        <div id="x4div" className={x4 ? "Aparece" : "escondido"}>
          <Celula id="x41"></Celula>
          <Celula id="x42"></Celula>
          <Celula id="x43"></Celula>
          <Celula id="x44"></Celula>
          <Celula id="x45"></Celula>
          <Celula id="x46"></Celula>
          <Celula id="x47"></Celula>
          <Celula id="x48"></Celula>
          <Celula id="x49"></Celula>
          <Celula id="x410"></Celula>
          <Celula id="x411"></Celula>
          <Celula id="x412"></Celula>
          <Celula id="x413"></Celula>
          <Celula id="x414"></Celula>
          <Celula id="x415"></Celula>
          <Celula id="x416"></Celula>
        </div>
        <div id="x5div" className={x5 ? "Aparece" : "escondido"}>
          <Celula id="x51"></Celula>
          <Celula id="x52"></Celula>
          <Celula id="x53"></Celula>
          <Celula id="x54"></Celula>
          <Celula id="x55"></Celula>
          <Celula id="x56"></Celula>
          <Celula id="x57"></Celula>
          <Celula id="x58"></Celula>
          <Celula id="x59"></Celula>
          <Celula id="x510"></Celula>
          <Celula id="x511"></Celula>
          <Celula id="x512"></Celula>
          <Celula id="x513"></Celula>
          <Celula id="x514"></Celula>
          <Celula id="x515"></Celula>
          <Celula id="x516"></Celula>
          <Celula id="x517"></Celula>
          <Celula id="x518"></Celula>
          <Celula id="x519"></Celula>
          <Celula id="x520"></Celula>
          <Celula id="x521"></Celula>
          <Celula id="x522"></Celula>
          <Celula id="x523"></Celula>
          <Celula id="x524"></Celula>
          <Celula id="x525"></Celula>
        </div>
      </div>
      <div className='lista'>
        <h1>Jogos</h1>
        <h3>Conteudo do bingo, 1 linha = 1 quadrado</h3>
        <textarea id='inputBingo' onChange={countLines} />
      </div>
    </div >

  );

}


export default Jogos;
